function removedupes(data){var arr=[];var existingTitles=[];$(data).each(function(index,value){var uppercase_title=value.title.toUpperCase();if(uppercase_title.indexOf('RE: ')>-1){if($.inArray(value.title.substring(16),existingTitles)==-1){currentobject={"title":value.title.substring(16),"pubDate":value.publishedDate,"author":value.author,"link":value.link.substring(0,value.link.length-5)};arr.push(currentobject);existingTitles.push(currentobject.title);}}else if($.inArray(value.title.substring(12),existingTitles)==-1){currentobject={"title":value.title.substring(12),"pubDate":value.publishedDate,"author":value.author,"link":value.link};arr.push(currentobject);existingTitles.push(currentobject.title);}});var data_array=[];$(arr).each(function(index,value){if(value.title.length>40){newobject={"tooltip":value.title,"title":value.title.substring(0,34)+" ...","pubDate":value.pubDate,"author":value.author,"link":value.link};data_array.push(newobject);}else{newobject={"tooltip":"","title":value.title,"pubDate":value.pubDate,"author":value.author,"link":value.link};data_array.push(newobject);}});return data_array;}$(document).ready(function(){var limit=4;$.ajax({url:'http://ajax.googleapis.com/ajax/services/feed/load?v=1.0&num=30&callback=?&q=https://community.rackspace.com/general/f/34/rss?Mode=0',dataType:'json',success:function(data,status,xhr){data_array=removedupes(data.responseData.feed.entries);var feedItems=data_array;$.each(data_array,function(i,item){if(i>3)return false;$('.generalDiscussions').append("<li class='muted'><a title='"+item.title+"' href='"+item.link+"'>"+item.title+"</a><br /><small>"+item.pubDate.substr(0,16)+" by "+item.author+"</small></li>");});}});$.ajax({url:'http://ajax.googleapis.com/ajax/services/feed/load?v=1.0&num=30&callback=?&q=https://community.rackspace.com/products/f/25/rss.aspx',dataType:'json',success:function(data,status,xhr){data_array=removedupes(data.responseData.feed.entries);var feedItems=data_array;$.each(feedItems,function(i,item){if(i>3)return false;$('.productDiscussions').append("<li class='muted'><a title='"+item.title+"' href='"+item.link+"'>"+item.title+"</a><br /><small>"+item.pubDate.substr(0,16)+" by "+item.author+"</small></li>");});}});$.ajax({url:'http://ajax.googleapis.com/ajax/services/feed/load?v=1.0&num=30&callback=?&q=https://community.rackspace.com/developers/rss',dataType:'json',success:function(data,status,xhr){console.log(data.responseData.feed.entries.length);data_array=removedupes(data.responseData.feed.entries);var feedItems=data_array;$.each(feedItems,function(i,item){if(i>3)return false;$('.developerDiscussions').append("<li class='muted'><a title='"+item.title+"' href='"+item.link+"'>"+item.title+"</a><br /><small>"+item.pubDate.substr(0,16)+" by "+item.author+"</small></li>");});}});});